import React from 'react';
import ButtonAppBar from './ButtonAppBar/ButtonAppBar.js';
import { MuiThemeProvider, createMuiTheme } from '@material-ui/core/styles';
import Paper from '@material-ui/core/Paper';
import Grid from '@material-ui/core/Grid';
import EnvelopeList from './CheckOut/EnvelopeList.js';
import Typography from '@material-ui/core/Typography';

const theme = createMuiTheme({
	palette: {
		primary: {
			main: "#B5D565"
		},
		secondary: {
			main: "#FAEBD7"
		}
	}
});

class CheckOutPage extends React.Component {

	render() {
		return (
			<div>
                <MuiThemeProvider theme={theme}>
                    <div>
                        <ButtonAppBar/>
                    </div>
                    <Grid container justify='center' spacing={8} style={{padding: '50px'}}>
                        <Grid item sm={10} style={{minHeight: '200px'}}>
                            <Paper style={{padding:'50px'}}>
                                <Typography variant='h5'>Envelopes</Typography>
                                <EnvelopeList/>
                            </Paper>
                        </Grid>
                        <Grid item sm={8} style={{minHeight: '200px'}}>
                            <Paper style={{padding:'50px'}}>
                            </Paper>
                        </Grid>
                    </Grid>
                </MuiThemeProvider>
            </div>
        );
				}	
}

export default CheckOutPage;
